import Feature from './Feature';
import styled from 'styled-components';
import { mediaQuery } from '../utils/style';

const layoutStyle = {
  //padding: 20,
  border: '1px solid #DDD',
  height: '350px',
  maxWidth: '1200px',
  margin: 'auto',
  backgroundColor: '#f2f2f2',
};

const FeatureLayout = props => (
  <div>
    <div>
      <Feature />
      {props.children}
    </div>
  </div>
);

export default FeatureLayout;
